import React from 'react';
import { Navbar,Nav } from 'react-bootstrap';
import {Link} from 'react-router-dom';

class Head extends React.Component{

	constructor( ...args){
		super(...args);
	}


	componentWillMount() {
		this.state = {
			count:1
		};
	}
	render(){
		return (
			<Navbar bg="dark" variant="dark" expand="lg" className="container">
				<Navbar.Brand href="home">众筹DApp</Navbar.Brand>
				<Nav className="mr-auto">
					{/*<Nav.Link as="Link" to="/">Home</Nav.Link>

					<Nav.Link as="Link" to="newproject">创建一个众筹项目</Nav.Link>

					<Nav.Link as="Link" to="project">Pricing</Nav.Link>*/}

					<Nav.item>
						<Link to="/">Home</Link>
					</Nav.item>
					<Nav.item>
						<Link to="/newproject">创建一个众筹项目</Link>
					</Nav.item>
					<Nav.item>
						<Link to="/project">Pricing</Link>
					</Nav.item>
				</Nav>

				<button onClick={()=>this.setState({count:this.state.count+1})}>
					{this.state.count}
				</button>
			</Navbar>
		);
	}
}
export default Head;
